import MainNavigation from './compenents/layout/MainNavigation';
import Home from './Home';
import {BrowserRouter as Routes,Router} from'react-router-dom';


function App() {
	return (
		<Router><div>
			<MainNavigation/>
			<Switch>
				<Route exact path="/">
					<Home />
				</Route>
			</Switch>
		</div>
		</Router>
	);
}

export default App;
